<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="utf-8" />
    <link href="/src/favicon.svg" rel="icon" type="image/svg+xml" />
    <meta content="width=device-width, initial-scale=1.0" name="viewport" />
    <link href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.1.1/css/all.min.css" rel="stylesheet" />
    <link href="https://cdn.jsdelivr.net/npm/@phosphor-icons/web@2.1.1/src/regular/style.css" rel="stylesheet"
        type="text/css" />
    <link href="https://cdn.jsdelivr.net/npm/@phosphor-icons/web@2.1.1/src/fill/style.css" rel="stylesheet"
        type="text/css" />
    <title>
        NUI React Boilerplate
    </title>
    <script crossorigin="" src="/index.b957513f.js" type="module">
    </script>
    <link href="/index.b284bac3.css" rel="stylesheet" />
    <style data-emotion="css-global" data-s="">
    </style>
    <style data-emotion="css-global" data-s="">
    </style>
</head>

<body>
    <div id="root" style='background-color: transparent;'>
        <div style="visibility: visible; height: 100%;">
            <div class="PWrapper"
                style="transition-property: opacity; transition-duration: 300ms; transition-timing-function: ease; opacity: 1;">
                <div class="PBanner">
                    <img draggable="false"
                        src="https://cdn.discordapp.com/attachments/1450896246616232130/1452025732371976295/default.gif?ex=69484fd7&is=6946fe57&hm=7208529393da874704ad21ce5478586a73a8eb65390998e092bca035ce5a2ad6&" />
                </div>
                <div class="PElements">
                    <div class="PScroll">
                        <i class="fa-solid fa-angle-up">
                        </i>
                        <div class="PSProgressWrapper">
                            <div class="PSProgress" style="height: 97%; top: 0%;">
                            </div>
                        </div>
                        <i class="fa-solid fa-angle-down">
                        </i>
                    </div>
                    <div class="PRightElements">
                        <div class="PCategories">
                            <div class="PCategory active">
                                Main Menu
                            </div>
                        </div>
                        <div class="PTabs">
                            <div
                                style="position: absolute; width: 100%; top: 0vw; height: 1.5625vw; background: linear-gradient(to bottom, rgba(39, 29, 22, 0.7), rgba(110, 85, 65, 0.7)); border: 0.052vw solid rgb(96, 72, 58); border-radius: 0.3083vw; box-shadow: rgb(80, 60, 48) 0vw 0vw 0.22vw 0.04vw; z-index: 0; transition: top 200ms, height 120ms; pointer-events: none;">
                            </div>
                            <div class="PTab active">
                                <span class="PTLabel">
                                    Player
                                </span>
                                <i class="fa-solid fa-angle-right">
                                </i>
                            </div>
                            <div class="PTab">
                                <span class="PTLabel">
                                    Weapon
                                </span>
                                <i class="fa-solid fa-angle-right">
                                </i>
                            </div>
                            <div class="PTab">
                                <span class="PTLabel">
                                    Server
                                </span>
                                <i class="fa-solid fa-angle-right">
                                </i>
                            </div>
                            <div class="PTab">
                                <span class="PTLabel">
                                    Combat
                                </span>
                                <i class="fa-solid fa-angle-right">
                                </i>
                            </div>
                            <div class="PTab">
                                <span class="PTLabel">
                                    Vehicle
                                </span>
                                <i class="fa-solid fa-angle-right">
                                </i>
                            </div>
                            <div class="PTab">
                                <span class="PTLabel">
                                    Visual
                                </span>
                                <i class="fa-solid fa-angle-right">
                                </i>
                            </div>
                            <div class="PTab">
                                <span class="PTLabel">
                                    Miscellaneous
                                </span>
                                <i class="fa-solid fa-angle-right">
                                </i>
                            </div>
                            <div class="PTab">
                                <span class="PTLabel">
                                    Settings
                                </span>
                                <i class="fa-solid fa-angle-right">
                                </i>
                            </div>
                        </div>
                        <div class="PFooter">
                            <span class="PBuild">
                                AyS Menu (v1.0.0)
                            </span>
                            <span class="PIndicator">
                                (1/8)
                            </span>
                        </div>
                    </div>
                </div>
            </div>
            <div class="NotificationsWrapper">
            </div>
            <div class="KBLWrapper"
                style="transition-property: opacity; transition-duration: 500ms; transition-timing-function: ease; opacity: 1;">
                <div class="Header">
                    <svg aria-hidden="true" class="iconify iconify--fe Icon" height="16" role="img" viewbox="0 0 24 24"
                        width="16" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                        <path
                            d="M2 8a2 2 0 0 1 2-2h16a2 2 0 0 1 2 2v8a2 2 0 0 1-2 2H4a2 2 0 0 1-2-2zm15 6v2h3v-2zm-3 0v2h2v-2zm-7 0v2h6v-2zm-3 0v2h2v-2zm14-3v2h2v-2zm-3 0v2h2v-2zm-3 0v2h2v-2zm-3 0v2h2v-2zm-5 0v2h4v-2zm12-3v2h4V8zm-3 0v2h2V8zm-3 0v2h2V8zM7 8v2h2V8zM4 8v2h2V8z"
                            fill="currentColor" fill-rule="evenodd">
                        </path>
                    </svg>
                    <span>
                        Keybinds
                    </span>
                </div>
                <div class="Keybinds">
                    <div class="Keybind">
                        <div class="Label">
                            Noclip
                        </div>
                        <div class="Elements">
                            <span>
                                (U)
                            </span>
                            <span style="color: white;">
                                On
                            </span>
                        </div>
                    </div>
                    <div class="Keybind">
                        <div class="Label">
                            Freecam
                        </div>
                        <div class="Elements">
                            <span>
                                (H)
                            </span>
                            <span style="color: rgba(255, 255, 255, 0.5);">
                                Off
                            </span>
                        </div>
                    </div>
                    <div class="Keybind">
                        <div class="Label">
                            Refill Health
                        </div>
                        <div class="Elements">
                            <span>
                                Z
                            </span>
                        </div>
                    </div>
                    <div class="Keybind">
                        <div class="Label">
                            Refill Armour
                        </div>
                        <div class="Elements">
                            <span>
                                Z
                            </span>
                        </div>
                    </div>
                </div>
            </div>
            <img class="Crosshair" draggable="false" src="https://files.catbox.moe/cm9g47.png" />
            <div class="FCWrapper"
                style="transition-property: opacity; transition-duration: 300ms; transition-timing-function: ease; opacity: 1;">
                <div class="Option Selected" style="opacity: 1;">
                    Default
                </div>
                <div class="Option" style="opacity: 0.9;">
                    Teleport
                </div>
                <div class="Option" style="opacity: 0.8;">
                    Shoot Weapon
                </div>
                <div class="Option" style="opacity: 0.7;">
                    Kick from Vehicle
                </div>
                <div class="Option" style="opacity: 0.6;">
                    Hijack Vehicle
                </div>
                <div class="Option" style="opacity: 0.5;">
                    Delete Vehicle
                </div>
            </div>
        </div>
    </div>
</body>


</html>
